import React from "react";


const course = [
  {
    name: "cs5610",
    term: "20fall",
  },
  {
    name: "cs5200",
    term: "20fall",
  },
  {
    name: "cs4560",
    term: "20fall",
  },
];

const CourseListComponent = ({ instructer, term }) => (
  <div className="con">
    <h1>
      Course List (For {instructer} at {term}){" "}
    </h1>
    <table className="table">
      {
        course.map(item => 
          <tr>
          <td>{item.name}</td>
          <td>{item.term}</td>    
          </tr>
        ) //iterate the elememnt
      }
    </table>
  </div>
);

export default CourseListComponent;
